import React from 'react';

const Disperse = () => {
  return (
    <div style={{ width: "100%", height: "100vh", backgroundColor: 'whitesmoke', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
        <h4>Addresses with Amounts</h4>
      <div style={{ width: "90%",height:"90%", backgroundColor: "white", textAlign: "center" }}>
        <textarea cols={5} style={{ width: '80%',height:"80%",display:"block"}}></textarea>
      </div>
    </div>
  )
}

export default Disperse;
